	add("claim", "{\"term\":\"claim\", \"etymology\":{\"influencers\":[{},{},{}], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Middle english (1100-1500) \u0027claimen\u0027 from Old french (842-ca. 1400) \u0027claimer\u0027 \u0027clamer|lang\u003dfro\u0027 () from Latin {{m|la|clāmō||to call, cry out}}, from Proto-indo-european {{m|ine-pro|*kele-||to shout}}, which is imitative; see also Lithuanian \u0027kalba\u0027 (language) Old English \u0027hlōwan\u0027 (to low, make a noise like a cow) Old High German \u0027halan\u0027 (to call) Ancient Greek {{m|grc|καλέω||to call, convoke}}, \u0027κλεδον\u0027 (report, fame) \u0027κέλαδος\u0027 (noise) Middle Irish \u0027cailech\u0027 (cock) Latin {{m|la|calō||to call out, announce solemnly}}, Sanskrit \u0027उषःकाल|tr\u003duṣaḥkāla\u0027 (cock, \u0027literally\u0027 dawn-calling)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A demand of ownership made for something (e.g. claim ownership, claim victory\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A new statement of truth made about something, usually when the statement has yet to be verified\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A demand of ownership for previously unowned land (e.g. in the gold rush, oil rush\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A legal demand for compensation or damages\", \"priority\":4}]}, \"synonyms\":{}}");

	add("claire", "{\"term\":\"claire\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French \u0027claire\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"borrowed from the French form of Clara or Clare. Popular in the UK in the 1970s and the 1980s\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1887\u0027\u0027 Arthur Thomas Quiller-Couch: \u0027Dead Man\u0027s Rock.\u0027 BiblioBazaar,LLC,2007. ISBN 1434649393 page 198\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"quot;I told you I was called ,or that they called me \u0027\u0027Claire\u0027\u0027. Were you not surprised when you saw my name as Clarissa Lambert?\u0026quot\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"quot;Is that all?\u0026quot; I cried. \u0026quot;Why of course, I knew how common it is for actresses to take another name. I was even glad of it; for the name I know, your own name, is now a secret, and all the sweeter so. All the world admires Clarissa Lambert, but I alone love \u0027\u0027Claire\u0027\u0027 Luttrell, and know that \u0027\u0027Claire\u0027\u0027 Luttrell loves me.\u0026quot\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027 Wendy Harmer: \u0027Farewell My Ovaries\u0027. Allen\u0026amp;Unwin 2006. ISBN 1741146658 page 93\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A woman named \u0027\u0027Claire\u0027\u0027 should be able to describe the moon. Clair de Lune was of course one of \u0027\u0027Claire\u0027\u0027s favourite pieces of piano music\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"a rare spelling variant Clare, derived from the surname\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"1991\u0027\u0027 Amy Tan: \u0027The Kitchen God\u0027s Wife\u0027. Ivy Books 1991. ISBN 080410753X page 203\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"When we arrived in Hangchow, all the pilots were honored at a big banquet given by that famous American general with a lady\u0027s name, \u0027\u0027Claire\u0027\u0027 Chennault\", \"priority\":9}]}, \"synonyms\":{}}");

	add("clairgustance", "{\"term\":\"clairgustance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"Presumably from 17th century French \u0027clair|lang\u003dfr\u0027 () + \u0027gustance\u0027\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The paranormal ability to taste a substance without putting anything in one\u0027s mouth. It is claimed that those who possess this ability are able to perceive the essence of a substance from the spiritual or ethereal realms through taste\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clairvoyance", "{\"term\":\"clairvoyance\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French French|clairvoyance\u0027.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The power to see the future\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clamp", "{\"term\":\"clamp\", \"etymology\":{\"influencers\":[], \"languages\":[\"middle dutch (ca. 1050-1350)\", \"English\"], \"text\":\"From Middle dutch (ca. 1050-1350) {{m|dum|clamp}}, {{m|dum|klampe||a clamp, hook}}, from Proto-germanic {{m|gem-pro|*klampō||clamp, clasp, cramp}}. Cognate with Middle Low German {{m|gml|klampe||hook, clasp}}, German {{m|de|Klampfe}}, {{m|de|Klampe||clamp, cleat}}, Norwegian {{m|no|klamp||clamp}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A brace, band, or clasp for strengthening or holding things together\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A mass of bricks heaped up to be burned; or of ore for roasting, or of coal coking\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A piece of wood (batten) across the grain of a board end to keep it flat, as in a breadboard\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A heavy footstep; a tramp\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Electronics) Electronic circuit to fix a voltage (see w:Clamper Wikipedia\", \"priority\":5}]}, \"synonyms\":{}}");

	add("clambake", "{\"term\":\"clambake\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|clam|bake|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An informal beach party in which food, usually seafood, is cooked in a pit dug in the sand, filled with hot coals\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An instance of smoking (usually marijuana) in an enclosed space\", \"priority\":2}]}, \"synonyms\":{}}");

