	add("clamor", "{\"term\":\"clamor\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Recorded in English since c. 1385, from Old french (842-ca. 1400) \u0027clamor\u0027 (modern \u0027clameur\u0027 , from Latin {{m|la|clāmor||a shout, cry}}, from {{m|la|clāmō||cry out, complain}}; the sense to silence may have a distinct (unknown) etymology.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A great outcry or vociferation; loud and continued shouting or exclamation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any loud and continued noise\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A continued public expression, often of dissatisfaction or discontent; a popular outcry\", \"priority\":3}]}, \"synonyms\":{}}");

	add("clamour", "{\"term\":\"clamour\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"From Latin {{m|la|clāmor||a shout, cry}}, from {{m|la|clāmō||cry out, complain}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Chaucer (Wife of Bath\u0027s Tale\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Ffor which oppression was swich \u0027\u0027clamour\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Shakespeare (Love\u0027s Labours Lost\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Sickly eares Deaft with the \u0027\u0027clamours\u0027\u0027 of their owne deare grones\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Addiso\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Here the loud Arno\u0027s boist\u0027rous \u0027\u0027clamours\u0027\u0027 cease\", \"priority\":6}]}, \"synonyms\":{}}");

	add("clamper", "{\"term\":\"clamper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|clamp|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, clamps\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"If you park your car in a no-parking zone, watch out for \u0027\u0027clampers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"An attachment with sharp metal prongs, attached to a boot or shoe to enable the wearer to walk securely upon ice\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Both divisions are provided with \u0027\u0027clampers\u0027\u0027, to steady them and their sledges on the irregular ice-surface\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"A circuit that restricts the amplitude of a waveform\", \"priority\":5}]}, \"synonyms\":{}}");

