	add("clandestineness", "{\"term\":\"clandestineness\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|clandestine|ness|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state or quality of being clandestine\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clanger", "{\"term\":\"clanger\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{suffix|clang|er|gloss1\u003dloud ringing sound|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A very noticeable mistake; an attention-getting faux pas\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"He dropped a real \u0027\u0027clanger\u0027\u0027 when he criticized the paraplegic for not standing\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1965\u0027\u0027, Anthony Howard, Richard West, \u0027The Road to Number 10\u0027, %22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;dq\u003d%22clanger%22|%22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003diecnT4XbK6OriAeynfS8Ag\u0026amp;redir_esc\u003dy page 215\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"When a woman heckler at Rayleigh shouted, “No more clangers!” Brown proudly rejoined: “Now listen, dear. My latest clanger was to say that people should be allowed to buy houses at lower rates of interest than you can get them for at the moment. I stand by that\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1976\u0027\u0027, \u0027Musical Opinion\u0027, Volume 100, %22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;dq\u003d%22clanger%22|%22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dH7YnT6vnAtD2mAW0rbTMAw\u0026amp;redir_esc\u003dy page 244\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Furthermore if a person drops even a little \u0027\u0027clanger\u0027\u0027 not only will he know but the others will know and the offender will certainly know that they know\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, w:Jasper Jasper Fforde, \u0027w:The Fourth The Fourth Bear\u0027, 2009, %22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d5rsnT92qJoGemQX9uImmAw\u0026amp;redir_esc\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"%22clangers%22%20-intitle%3A%22clanger|clangers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"‘I say,’ he added, changing the subject completely and leaning closer, ‘sorry to hear about that Riding-Hood debacle. Don′t let it get you down, eh? We all drop a serious \u0027\u0027clanger\u0027\u0027 sooner or later\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A mistake made by a player; \u0027counted in the game statistics in the category \u0026quot;errors including frees against\u0026quot\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Jim Main, Rohan Connolly, \u0027More Than a Century of AFL Grand Finals\u0027, %22clangers%22+afl+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dhfknT-uLNq2ViAeftJWyAg\u0026amp;redir_esc\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u0026amp;f\u003dfalse page 202\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"Geelong could not get their running game going and lapsed into \u0027\u0027clanger\u0027\u0027 after \u0027\u0027clanger\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"Something that clangs; an alarm bell (\u0027also figuratively\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"1972\u0027\u0027, \u0027The Saturday review\u0027, Volume 55, Part 2, %22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;dq\u003d%22clanger%22|%22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dsbMnT_jRB8L0mAWAssyrAw\u0026amp;redir_esc\u003dy page 21\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"The front and patio doors are bugged. When you open one a contact breaks and off goes the \u0027\u0027clanger\", \"priority\":16},{\"upperType\":\"NOUN\", \"text\":\"2005\u0027\u0027, w:Mark Mark Latham, \u0027w:The Latham The Latham Diaries\u0027, %22clangers%22+afl+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dCPsnT7XpHK-SiAeuja3MAg\u0026amp;redir_esc\", \"priority\":17},{\"upperType\":\"NOUN\", \"text\":\"%22clangers%22%20afl%20-intitle%3A%22clanger|clangers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":18},{\"upperType\":\"NOUN\", \"text\":\"The conversation was hard-going; we didn\u0027t click at all, but then he dropped the \u0027\u0027clanger\u0027\u0027: Beazley has done a lunch with Maxine McKew and ‘It will be read as he wants to come back. Our people want to go big with it\", \"priority\":19},{\"upperType\":\"NOUN\", \"text\":\"2007\u0027\u0027, Stephen H. Foreman, \u0027Toehold\u0027, %22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dG8wnT7G5NaWQiQeO_IHuAg\u0026amp;redir_esc\", \"priority\":20},{\"upperType\":\"NOUN\", \"text\":\"%22clangers%22%20-intitle%3A%22clanger|clangers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse page 195\", \"priority\":21},{\"upperType\":\"NOUN\", \"text\":\"Anyway, this \u0027\u0027clanger\u0027\u0027 sounds. We put out our smokes, shoulder our packs, put on our helmets. The drill was that you turned around and handed your rifle to the guy behind you who then attached it to your pack while you attached the rifle of the guy in front of you to his pack\", \"priority\":22},{\"upperType\":\"NOUN\", \"text\":\"The clapper of a bell, anything that strikes a bell or other metal object to make a ringing sound\", \"priority\":23},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Courtway Jones, \u0027Witch of the North\u0027, %22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;dq\u003d%22clanger%22|%22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003diecnT4XbK6OriAeynfS8Ag\u0026amp;redir_esc\u003dy page 254\", \"priority\":24},{\"upperType\":\"NOUN\", \"text\":\"I dismounted and walked over to Pelleas. “You may remember me, my Lord,” I said. “You once made me a knife from a bell \u0027\u0027clanger\u0027\u0027. I am Morgan, Queen of Galloway\", \"priority\":25},{\"upperType\":\"NOUN\", \"text\":\"1998\u0027\u0027, Dick Hyson, \u0027 The Calling\u0027, %22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;dq\u003d%22clanger%22|%22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dVOwnT8yeHI-kiAfS5KnAAg\u0026amp;redir_esc\u003dy page 100\", \"priority\":26},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027clanger\u0027\u0027 was made out of the same material, and attached to a chain at one end. The idea was to stick the \u0027\u0027clanger\u0027\u0027 in the opening of the triangle and start circulating, whacking the triangle on all three sides as fast as you could\", \"priority\":27},{\"upperType\":\"NOUN\", \"text\":\"2011\u0027\u0027, Jerry Spinelli, \u0027Milkweed\u0027, %22clangers%22+-intitle:%22clanger|clangers%22+-inauthor:%22%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003dz_InT7biN46hiQfi3NjBAg\u0026amp;redir_esc\", \"priority\":28},{\"upperType\":\"NOUN\", \"text\":\"%22clangers%22%20-intitle%3A%22clanger|clangers%22%20-inauthor%3A%22%22\u0026amp;f\u003dfalse unnumbered page\", \"priority\":29},{\"upperType\":\"NOUN\", \"text\":\"He showed me where to pull the \u0027\u0027clanger\u0027\u0027, and I pulled and pulled and the clanging joined the music of the bombardment\", \"priority\":30},{\"upperType\":\"NOUN\", \"text\":\"An early hi-hat consisting of cymbals mounted on the rim of a bass drum and struck with an arm on the drum\u0027s pedal\", \"priority\":31}]}, \"synonyms\":{}}");

	add("clangour", "{\"term\":\"clangour\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A loud, repeating clanging sound; a loud racket; a din\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1920\u0027\u0027, w:D. H. D. H. Lawrence, \u0027s:Women in Love/Chapter Women in Love\u0027, Chapter XXIV: Death and Love\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"And always, as the dark, inchoate eyes turned to him, there passed through Gerald\u0027s bowels a burning stroke of revolt, that seemed to resound through his whole being, threatening to break his mind with its \u0027\u0027clangour\u0027\u0027, and making him mad\", \"priority\":3}]}, \"synonyms\":{}}");

	add("clapcake", "{\"term\":\"clapcake\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|clap|cake|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"oatmeal cake or bread clapped or beaten until thin\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clapham", "{\"term\":\"clapham\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An area of London, mostly in Lambeth\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of several other places in England\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"derived from these places\", \"priority\":3}]}, \"synonyms\":{}}");

	add("clapperboard", "{\"term\":\"clapperboard\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|clapper|board|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A device used in film production, having hinged boards that are brought together with a clap, used to synchronize picture and sound at the start of each take of a motion picture or other video production\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clapstick", "{\"term\":\"clapstick\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{compound|clap|stick|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A kind of drumstick used by striking one against another, to maintain rhythm in Aboriginal voice chants\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A clapperboard\", \"priority\":2}]}, \"synonyms\":{}}");

	add("claptrap", "{\"term\":\"claptrap\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Theater slang, circa|c. 1730, from cla. Verb|clap and tra. Noun|trap, referring to theatrical techniques or gags used to incite applause.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A contrivance for clapping in theaters\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A trick or device to gain applause; humbug\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Empty verbiage or nonsense\", \"priority\":3}]}, \"synonyms\":{}}");

	add("clara", "{\"term\":\"clara\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Latin \u0027clara\u0027, feminine of \u0027clarus\u0027, \u0026quot;bright, shining, clear\u0026quot;, a post-classical name made famous by the 13th century Saint Clara (Clare) of Assisi.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1830\u0027\u0027 Mary Russell Mitford: \u0027Our Village: Fourth Series: Cottage Names\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"But the fashion spreads deeper and wider; the village is infected and the village green; Amelias and \u0027\u0027Claras\u0027\u0027 sweep your rooms and cook your dinners, gentle Sophias milk your cows, and if you ask a pretty smiling girl at a cottage door to tell you her name, the rosy lips lisp out Caroline\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1956\u0027\u0027 Tad Mosel: \u0027Other People\u0027s Houses. Six Television Plays.\u0027 page 123\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"My mother called me \u0027\u0027Clara\u0027\u0027. And everybody else called me \u0027\u0027Clara\u0027\u0027 until I was fourteen years old. Then I got sick of it. \u0027\u0027Clara\u0027\u0027! Sounds like breaking glass. Did you ever stop to think of that, Frank? Say it fast and hit the C\", \"priority\":4}]}, \"synonyms\":{}}");

	add("clart", "{\"term\":\"clart\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"middle english (1100-1500)\"], \"text\":\"From Middle english (1100-1500) {{m|enm|*clart}}, found in the verb \u0027biclarten\u0027 (to cover or smear with dirt) Further origin uncertain.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A daub\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"a \u0027\u0027clart\u0027\u0027 of grease\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Sticky mud, mire or filth\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1997\u0027\u0027, \u0027Mason \u0026amp; Dixon\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"I’m but a county Surveyor,– not really at m’ best upon the grand and global type of expedition, content here at home, old Geordie a-slog thro’ the \u0027\u0027clarts\u0027\u0027 […\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"A person who is unclean\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A fool\", \"priority\":7}]}, \"synonyms\":{}}");

	add("clary", "{\"term\":\"clary\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"clary sag\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"clary\u0027\u0027 flowers\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027clary\u0027\u0027 plant\", \"priority\":3}]}, \"synonyms\":{}}");

	add("clarence", "{\"term\":\"clarence\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Originally a ducal title of the English and British royal family, believed to originate from the town of Clare, Suffolk, although it has also been associated with Clarentza in the Principality of Achaea.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A ducal title which has been traditionally awarded to junior members of the English and British royal familie\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A placename given to towns in countries settled by the British\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A name given to several rivers, including one in France and others in countries settled by the British\", \"priority\":3}]}, \"synonyms\":{}}");

	add("clarification", "{\"term\":\"clarification\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\"], \"text\":\"From French {{m|fr|clarification}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of clarifying; the act or process of making clear or transparent by freeing visible impurities; particularly, the clearing or fining of liquid substances from feculent matter by the separation of the insoluble particles which prevent the liquid from being transparent\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The act of freeing from obscurities\", \"priority\":2}]}, \"synonyms\":{}}");

	add("clarifier", "{\"term\":\"clarifier\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|clarify|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"One who, or that which, clarifies\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A vessel in which the process of clarification is conducted\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"the \u0027\u0027clarifier\u0027\u0027 in sugar works\", \"priority\":3}]}, \"synonyms\":{}}");

	add("clarion", "{\"term\":\"clarion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) from Old french (842-ca. 1400) {{m|fro|claron}}, from \u0027clario\u0027 (lang\u003dla) from Latin \u0027clarus\u0027 (lang\u003dla)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A medieval brass instrument, related to the trumpet, or its sound\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The \u0027\u0027clarion\u0027\u0027s call to action has been heard\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A different type of musical instrument resembling an organ\", \"priority\":3}]}, \"synonyms\":{}}");

	add("clarissa", "{\"term\":\"clarissa\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"Latin\"], \"text\":\"A Latinate form of Clarice, from Latin \u0027claritia\u0027 a fanciful medieval variant of Clara.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"1748\u0027\u0027 Samuel Richardson: \u0027Clarissa, or The History of a Young Lady\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"My wife\u0027s maiden name - \u0027Unmarried\u0027 name, I should rather say - - - was Harlowe - \u0027\u0027Clarissa\u0027\u0027 Harlowe - you heard me call her my \u0027\u0027Clarissa\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I did - but I thought it to be a feigned or a love-name, said Miss Rawlins\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"No - it was her real name, I said\", \"priority\":4}]}, \"synonyms\":{}}");

	add("clarity", "{\"term\":\"clarity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle english (1100-1500)\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"Middle english (1100-1500) \u0027claritee\u0027 from Old french (842-ca. 1400) \u0027clarté\u0027 from Latin \u0027claritas\u0027 from \u0027clarus|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state, or measure of being clear, either in appearance, thought or style; lucidity\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"She dreamed, with great \u0027\u0027clarity\u0027\u0027, that she had been seen her own death\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"Lack of \u0027\u0027clarity\u0027\u0027 on the part of the teacher will cause confusion among the students\", \"priority\":3}]}, \"synonyms\":{}}");

	add("clarkeite", "{\"term\":\"clarkeite\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"Frank Wigglesworth \u0027Clarke\u0027 (1847-1931), American mineral chemist, {{suffix||ite|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A uranium oxide mineral of variable composition and uncertain structure, its colour varying from dark brown to orange\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clasp", "{\"term\":\"clasp\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"English\"], \"text\":\"Noun dated in the 13th Century {{C.E.}} and verb dated in the late 14th Century {{C.E.}}; from claspe, possible modification of clapse, which is from Old english (ca. 450-1100) \u0027sc\u003dpolytonic|clyppan\u0027 (to grasp) Related to \u0027enclasp\u0027 (embrace, hold tightly in one\u0027s arms)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A fastener or holde\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"holder, particularly one that clasps\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"I always have a hard time working the \u0027\u0027clasp\u0027\u0027 on this necklace\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"An embrace, a grasp, or handshake\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"He took her hand in a firm \u0027\u0027clasp\", \"priority\":5}]}, \"synonyms\":{}}");

	add("class", "{\"term\":\"class\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"Latin\"], \"text\":\"From French \u0027classe\u0027 from Latin \u0027classis|lang\u003dla\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"thumb|(5) a school class\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A group, collection, category or set sharing characteristics or attributes\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A social grouping, based on job, wealth, etc. In Britain, society is commonly split into three main classes; upper class, middle class and working class\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"issue\u003d3|page\u003d21|magazine\u003d|title\u003d[http://www.guardian.co.uk/commentisfree/joris-luyendijk-banking-blog/2013/jun/19/banking-britain-beyond-control Our banks are out of passage\u003dSeeing the British establishment struggle with the financial sector is like watching an alcoholic\u0026amp;nbsp;[\u0026amp;hellip;].\u0026amp;nbsp; Until 2008 there was denial over what finance had become.\u0026amp;nbsp;[\u0026amp;hellip;]\u0026amp;nbsp; But the scandals kept coming, and so we entered stage three – what therapists call \u0026quot;bargaining\u0026quot;. A broad section of the political \u0027\u0027class\u0027\u0027 now recognises the need for change but remains unable to see the necessity of a fundamental overhaul. Instead it offers fixes and patches\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"The division of society into classes\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Admirable behavior; elegance\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"A group of students in a regularly scheduled meeting with a teacher\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"A series of classes covering a single subject\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A group of students who commenced or completed their education during a particular year. A school class\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"A category of seats in an airplane, train or other means of mass transportation\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"A rank in the classification of organisms, below phylum and above order; a taxon of that rank\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Best of its kind\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"A collection of sets definable by a shared property\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"A group of people subject to be conscripted in the same military draft, or more narrowly those persons actually conscripted in a particular draft\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"A set of objects having the same behavior (but typically differing in state), \u0027or\u0027 a template defining such a set\", \"priority\":15},{\"upperType\":\"NOUN\", \"text\":\"One of the sections into which a Methodist church or congregation is divided, supervised by a \u0027class leader\", \"priority\":16}]}, \"synonyms\":{}}");

	add("clast", "{\"term\":\"clast\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{back-form|clastic|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"a fragment of rock that was broken from a larger rock or rock unit\", \"priority\":1}]}, \"synonyms\":{}}");

	add("clasper", "{\"term\":\"clasper\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|clasp|er|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Anything that clasp\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Any of several appendages, in insects, crustacea and fish, that are used to clasp the female during copulation\", \"priority\":2}]}, \"synonyms\":{}}");

