	add("classicism", "{\"term\":\"classicism\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|classic|ism|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"All the classical traditions of the art and architecture of ancient Greece and Rome, especially the aspects of simplicity, elegance and proportion\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Classical scholarship\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A Latin or Ancient Greek expression used in an English sentence\", \"priority\":3}]}, \"synonyms\":{}}");

